import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';

export default function LogenHome() {

    const [userCount, setUserCount] = useState(0);

  useEffect(() => {
    const fetchUserCount = async () => {
      const response = await axios.get('http://localhost:8080/users/count');
      setUserCount(response.data);
    };

    fetchUserCount();
  }, []);

  return (
    <Container fluid>
      <Row className="py-3">
        <Col xs={3} className="bg-primary text-light p-3 justify-content-start">
          <h4>Friend list</h4>
        </Col>
        <Col xs={6} className="bg-secondary text-light p-3">
          <h4>Main screen</h4>
        </Col>
        <Col xs={3} className="bg-info text-light p-3 justify-content-end">
          <h4>Friend requests</h4>
        </Col>
      </Row>
      <Row className="justify-content-between p-2" style={{ backgroundColor: '#F2F2F2' }}>
        <Col xs={3} className="bg-light border rounded-start p-3">
          Column 1
        </Col>
        <Col xs={6} className="bg-light border p-3">
          Column 2
        </Col>
        <Col xs={3} className="bg-light border rounded-end p-3 text-end">
          Column 3
        </Col>
      </Row>
    </Container>
  )
}
